import * as echarts from 'echarts';
import 'echarts-wordcloud'
import { fontSize, TOOLTIP_STYLE, GRID, _cnDic, _divisor, intervalFnc, maxFnc, fontChart } from "../../utils";
export const initWordcloud01 = (dom) => {
    let image = `data:image/png;base64,`
    if (dom) {
        var maskImage = new Image();
            maskImage.src = image
        let option = {
            // maskImage:maskImage,
            tooltip: {
                show: true,
                position: 'top',
                textStyle: {
                    fontSize: 14
                }
            },
            series: [{
                type: "wordCloud",
                gridSize: 6,
                shape: 'circle',
                sizeRange: [10, 30],
                rotationRange: [0, 0],
                left: 'center',
                top: 'center',
                right: null,
                bottom: null,
                // 画布宽
                width: '99%',
                // 画布高
                height: '99%',
                // 是否渲染超出画布的文字
                drawOutOfBound: false,
                textStyle: {
                    color: function (params) {
                        let colors = ['#73c0de', '#ee6666', '#fac858', '#91cc75',
                            '#337ab7', '#5470c6']
                        return colors[Math.floor(Math.random() * 6)];
                    },
                },
                data: [{ name: 'name1', value: 1 }, { name: 'name2', value: 2 }, { name: 'name3', value: 3 }, { name: '1name3', value: 3 },
                 { name: '2name3', value: 3 }, { name: '3name3', value: 3 }]
            },
            ]
        }
        var chartDom = document.getElementById(dom);
        var myChart = echarts.init(chartDom);
        option && myChart.setOption(option);
        window.addEventListener("resize", () => {
            myChart.resize();
        })
    }
}

